package br.com.restaurante.model;import java.util.List;@SuppressWarnings("serial")public class CidModel extends BaseModel implements CrudModel<CidModel> {	private String descricao;	private String codigo;	private List<CidModel> historico;	public String getDescricao() {		return descricao;	}	public void setDescricao(String descricao) {		this.descricao = descricao;	}	public String getCodigo() {		return codigo;	}	public void setCodigo(String codigo) {		this.codigo = codigo;	}	public List<CidModel> getHistorico() {		return historico;	}	public void setHistorico(List<CidModel> historico) {		this.historico = historico;	}	public String getDescricaoCompleta() {		return this.codigo + " - " + this.descricao;	}}